import React, { useState } from "react";
import { useDispatch } from "react-redux";
import { removeRow } from "../../../../../redux/actions";
import CrossButton from "../../../../CrossButton";
import setCellRenderer from "../setCellRenderer";
import IncrementCell from "../CellRenderer/IncrementCell";
import RowFragment from "../RowFragment";

const TableRow = ({ rowNumber, rowData }) => {
   const dispatch = useDispatch();
   const Renderer = setCellRenderer(showPercentageValue, IncrementCell);

   return (
      <tr>
         <RowFragment
            label={rowNumber}
            rowValues={rowData}
            RendererType={IncrementCell}
         />
         <td>
            <CrossButton
               buttonClickHandler={() => dispatch(removeRow(rowNumber))}
            />
         </td>
      </tr>
   );
};

export default TableRow;
